import { useEffect, useState } from "react";

function Example() {

    let [data, setdata] = useState([])

    useEffect(() => {
        fetch("https://gorest.co.in/public/v2/users").then((res) => res.json()).then((user) => {
            setdata(user)
        })
    }, [])

    return (
        <>
            <h1>Inactive Female</h1>
            {
                data.filter((e) => e.status === "inactive" ).filter((e.gender)).map((e) => {

                    // return (
                    //     <>

                    //         <p>{e.name}</p>
                    //     </>

                    // )
                })
            }
            <h2>Inactive Male</h2>

            {
                data.filter((e) => e.status === "inactive" && e.gender === "male").map((e) => {

                    return (
                        <>

                            <p>{e.name}</p>
                        </>

                    )
                })
            }
            <h2>Active Female</h2>

            {
                data.filter((e) => e.status === "active" && e.gender === "female").map((e) => {

                    return (
                        <>

                            <p>{e.name}</p>
                        </>

                    )
                })
            }
            <h2>Active Male</h2>

            {
                data.filter((e) => e.status === "active" && e.gender === "male").map((e) => {

                    return (
                        <>

                            <p>{e.name}</p>
                        </>

                    )
                })
            }
        </>
    )

}

export default Example
